import React, { Component } from 'react';

class Product extends Component {
  render() {
    const {imageUrl, offerText, brandName, productName, price, mrf, quantity} = this.props.product;
    return (
      <div style={{}}>
        <div style={{display: "inline-block"}}>
          <img style={{}} src={imageUrl} alt="product" />
          <div>{offerText} OFF</div>
        </div>
        <div style={{display: "inline-block"}}>
          <div>{brandName}</div>
          <div>{productName}</div>
          <div>{quantity}</div>
          <div>{price}</div>
          <div>{mrf}</div>
        </div>
      </div>
    );
  }
}

export default Product;
